column8:
高い安全性を確保しながら強力な除菌・抗菌・消臭性能を実現<br>
<br>
世界初、高い安全性を確保しながら強力な抗菌力を実現しました。<br>
G2TAM α PLUSにより、食中毒の原因菌であるノロウイルスや新型インフルエンザH1N1ウイルスの完全不活化に成功。<br>
その他、SARS、セレウス芽胞、鳥インフルエンザウイルス、O-157、大腸菌、緑膿菌など、ご家庭や一般企業、医療機関などで脅威となるウイルスや細菌、カビに対し、強い抗菌・除菌効果を発揮しながら、第三者機関で検証された人体や環境に対する高い安全性を実現した世界初の抗菌消臭剤です。<br>
<br><br>
◆使用方法<br>
抗菌したいところや匂いのもとに20～30cm離して直接スプレーして下さい。<br>
1m2の面積に対して7～8回（2～2.5ml前後）噴霧して下さい。<br>
布やティッシュペーパーなどに含ませて抗菌・消臭したいところを拭いても同じ効果が得られます。<br>
<br>
◆使用用途<br>
◎カーペット・畳・カーテン・布製のソファ・衣類・ベッド・布団・押入れ・靴箱・風呂場・トイレ・排水溝・自動車内・エアコンフィルター・縫いぐるみ・ペット周りの臭いなど、職場や家庭内のあらゆる場所の抗菌と消臭と防カビ。<br>
◎おう吐物・排泄物・生ゴミの抗菌・消臭。<br>
◎ホルムアルデヒドの分解・消臭。<br>
<br><br>
◆高い安全性<br>
従来の抗菌剤の主流は、成分が銀、銅、亜鉛などの金属イオンを利用した無機系抗菌剤でしたが、ジーツータムは、金属を全く含まず、大豆アミノ酸を主成分とした非常に安全性の高い、消臭・抗菌剤です。<br>
公正な第三者機関でさまざまな試験を実施し、高い安全性を確認しています。<br>
<br>
◆効果のある主な菌名<br>
◎ネコカリシウイルス(Feline calicivirus vaccine strain)※ノロウイルス代替<br>
◎SARSウイルス(BJ-01株)<br>
◎枯草菌(Bacillus subtilis RIM0225014 ATCC9372)<br>
◎高病原性鳥インフルエンザウイルス(A/whistling swan/Shimane/499/83/(H5N3)株)<br>
◎腸管出血性大腸菌<br>
◎O-157(Escherichia coli 0-157 H-7(IID959))<br>
◎メチシリン耐性黄色ブドウ球菌(Methicillin Resistant Staphylococcus IID1677(MRSA))<br>
◎大腸菌(Escherichia coli IFO3972)<br>
◎緑膿菌(Pseudomonas aeruginosa IFO13257)<br>
◎白癬菌(Trichophyton mentagrophytes IFO6202)<br>
◎レジオネラ菌(Legionella pneumophila)<br>
◎サルモネラ菌(Salmonella enteritidis IFO3313)<br>
◎カンジダ菌(Candida albicans, ATCC 10231)<br>
◎カビ(5菌株)　JIS　Z2911(1992)<br>
<br>
◆強い消臭力<br>
G2TAMαPLUSは、臭気の感知器官である鼻粘膜を刺激する、イオン性を持つ臭気ガス微粒子を、大豆アミノ酸と界面活性剤の消臭力で吸着分解し、粘膜を刺激しない物質に変化させます。<br>
また、腐敗や発酵により悪臭成分を作り出す細菌やカビ類を、強い抗菌力により抑制します。<br>
<br>
◆長い持続力<br>
JIS規格の防カビ試験で28日間カビの発生防止を実証<br>
